export default class JWTAuthInterceptor{constructor(){this.http={}}setHttp(t){this.http=t}update(){this.http.interceptors&&(this.http.interceptors.request.use(function(t){var e=localStorage.getItem("clusterpost_token");return e&&(t.headers.authorization="Bearer "+e),t},function(t){return Promise.reject(t)}),this.http.interceptors.response.use(function(t){return t},function(t){return Promise.reject(t)}))}}